class App extends Component {
  render() {
      return (
        <BrowserRouter>
        <div>
          <NavBar/>
        </div>
        <Switch>
            <Route path = '/' component={Dashboard}/>
        </Switch>
        </BrowserRouter>
    );
  }
}

export default App;
